import React, { Component } from 'react'

export default class Lorder extends Component {
    render() {
        return (
            <div className="lorder">
                <span className="back">
                    <span>L</span>
                    <span>o</span>
                    <span>a</span>
                    <span>d</span>
                    <span>i</span>
                    <span>n</span>
                    <span>g</span>
                </span>
            </div>
        )
    }
}
